    return (
        <div className="next">
            <h5 className="next__heading">NEXT VIDEO</h5>
            <div className="comments__form__left">
                <img className="comments__form__user-picture" src={userPicture} alt="" />
            </div>
            <div className="comments__form__right">
                <span>

                </span>
                <span>

                </span>
            </div>
        </div>
    );
}
